import { Routes, Route } from 'react-router-dom';
import Home from './Home';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" >
          {/* Index route: rendered when path is exactly "/" */}
          <Route index element={<Home />} />
        </Route>
      </Routes>
    </Router>
  );
}

export default App;
